import React, { useState } from 'react'
import { useNavigate } from 'react-router-dom';
import { AllRestsBtn } from '../Body/PopularRestaurants/StylePopularRests';
import { SearchL } from './StyleHeader'
export default function SearchLogo(){
  const navigate = useNavigate();
  const[ Status , setStatus ] = useState(1);
    const NavToSearch = () =>{

        if(Status==0){
          setStatus(1);
          navigate('/HomePageEmptyBag');}
        else{
          setStatus(0);
          navigate('/');}
    };
  return (
    <div>
        <AllRestsBtn onClick={NavToSearch}><SearchL/></AllRestsBtn>
    </div>
  )
}
